def get_lucid_number(n):
  """
  Gets the smallest lucid number less than or equal to n.

  A lucid number is a non-negative integer where each digit in its decimal 
  representation is equal to the count of occurrences of that digit in the number.

  Args:
    n: The upper limit for the search.

  Returns:
    The smallest lucid number less than or equal to n, or -1 if none exists.
  """

  def is_lucid(num):
    num_str = str(num)
    digit_counts = {}
    for digit in num_str:
      if digit in digit_counts:
        digit_counts[digit] += 1
      else:
        digit_counts[digit] = 1
    for digit in num_str:
      if digit_counts[digit] != int(digit):
        return False
    return True

  for i in range(n + 1):
    if is_lucid(i):
      return i
  return -1

# Example usage
